import {useState, useEffect} from 'react'
import API_KEY from './keys'

const CONTEXT_KEY = "b097df3cc5880175a";

const proxyurl = "https://cors-anywhere.herokuapp.com/";
const url = 'https://api.liveconnect.in/backend/web/erpsync/get-all-orders?data=dbCode=UAT04M%7Cidx=100%7CuserId=6214%7Cres_format=1'; // site that doesn’t send Access-Control-*
fetch(proxyurl + url).then((resp) => resp.json())
  .then(function(data) {
    console.log(data);
  })
  .catch(function(error) {
    console.log(error);
  }); 



const useGoogleSearch = (term) => { 
  const [data, setData] = useState(null);

  useEffect(()=>{
    const fetchData = async() => {
      fetch(
        `https://wwww.googleapis.com/customsearch/v1?key=${API_KEY}&cx=${CONTEXT_KEY}&q=${term}`
      )
      .then(response => response.json())
      .then(result => {
        setData(result)
      })
    }

    fetchData();
  }, [term])

  return {data}
}

export default useGoogleSearch
